import React, { useEffect, useState } from 'react';
import './floating-notes.scss';
import io from 'socket.io-client';

const FloatingNotes = () => {

  return(
    <div className="floating_main_cont">
      <div className="floating_note_cont">
        <img src="/static/random/r1.jpg" alt=""/>
        <a href="#">star green</a>
        <p>Le gusta tu post</p>
      </div>
    <style jsx>{`
      .floating_main_cont{
        position: fixed;
        top: 0;
        left: 0;
        border: 1px solid red;
        width: 30%;
        height: 100vh;
        display: flex;
        flex-direction: column;
        justify-content: flex-end;
        z-index: 50;
      }
      .floating_note_cont{
        width: 50%
        height: 80px;
        background: #eee;
        padding: .5rem;
        position: relative;
        z-index: 50;
      }
      img{
        width: 40px;
        height: 40px;
        border-radius: 50%;
        object-fit: cover;
        object-position: center;
      }
    `}
    </style>
    </div>
  )
}

export default FloatingNotes;
